import React from 'react';
import Link from '@material-ui/core/Link';
import { makeStyles,withStyles } from '@material-ui/core/styles';
import Table from '@material-ui/core/Table';
import TableContainer from '@material-ui/core/TableContainer';
import TableBody from '@material-ui/core/TableBody';
import TableCell from '@material-ui/core/TableCell';
import TableHead from '@material-ui/core/TableHead';
import TableRow from '@material-ui/core/TableRow';
import Typography from '@material-ui/core/Typography';
import Title from './Title';
import { Button, Paper } from '@material-ui/core';

// Generate Order Data


function preventDefault(event) {
  event.preventDefault();
}



export default function Orders() {
 
    

   const useStyles = makeStyles((theme) => ({
    seeMore: {
      marginTop: theme.spacing(3),
    },
    icon: {
      marginRight: theme.spacing(2),
    },
    table: {
      minWidth: 700,
    },
    heroContent: {
      backgroundColor: theme.palette.background.paper,
      padding: theme.spacing(4, 0, 6),
    },
    heroButtons: {
      marginTop: theme.spacing(4),
    },
    cardGrid: {
      paddingTop: theme.spacing(8),
      paddingBottom: theme.spacing(8),
    },
    card: {
      height: '100%',
      display: 'flex',
      flexDirection: 'column',
    },
    cardMedia: {
      paddingTop: '56.25%', // 16:9
    },
    cardContent: {
      flexGrow: 1,
    },
    footer: {
      backgroundColor: theme.palette.background.paper,
      padding: theme.spacing(6),
    },
    modal: {
      display: 'flex',
      alignItems: 'center',
      justifyContent: 'center',
    },
    paper: {
      backgroundColor: theme.palette.background.paper,
      border: '2px solid #000',
      boxShadow: theme.shadows[5],
      padding: theme.spacing(2, 4, 3),
    }
  }));
  const StyledTableCell = withStyles((theme) => ({
    head: {
      backgroundColor: theme.palette.common.black,
      color: theme.palette.common.white,
    },
    body: {
      fontSize: 14,
    },
  }))(TableCell);
  
  const StyledTableRow = withStyles((theme) => ({
    root: {
      '&:nth-of-type(odd)': {
        backgroundColor: theme.palette.action.hover,
      },
    },
  }))(TableRow);
  
  function createData(name, calories, fat, carbs, protein) {
    return { name, calories, fat, carbs, protein };
  }
  
  

  const classes = useStyles();
  return (
    <React.Fragment>
      <Title>Accept Doctor Sign up Request</Title>
      
      <TableContainer component={Paper}>
      <Table className={classes.table} aria-label="customized table">
        <TableHead>
          <TableRow>
            <StyledTableCell>ID</StyledTableCell>
            <StyledTableCell align="left">Email</StyledTableCell>
            <StyledTableCell align="left">Name</StyledTableCell>
            <StyledTableCell align="left">PMDC</StyledTableCell>
            <StyledTableCell align="left">Approval</StyledTableCell>
          </TableRow>
        </TableHead>
        <TableBody>
        
            <StyledTableRow key={row.name} >
              <StyledTableCell component="th" scope="row">
                id
              </StyledTableCell>
              <StyledTableCell align="left">email</StyledTableCell>
              <StyledTableCell align="left">fs ls </StyledTableCell>
              <StyledTableCell align="left">pmd</StyledTableCell>
              <StyledTableCell align="left">
              <Button color="primary" variant="outlined" >Accept</Button>  <Button variant="outlined" color="secondary">Reject</Button>
              </StyledTableCell>
            </StyledTableRow>
         
      
        </TableBody>
      </Table>
    </TableContainer>

          

      <div className={classes.seeMore}>
        <br/>
      <center>
      <Typography variant="h6">Reviews</Typography>
    </center>
    
      </div>
    </React.Fragment>
  );
}
